            this.说明label7.Size = new System.Drawing.Size(1022, 14);
            this.说明label7.TabIndex = 7;
            this.说明label7.Text = "点\"图片水印\"页上的\"选水印图\"按钮可打开一幅图片,此图片会被当作水印叠加在你打开的要加水印的图片上。在这打开的图片有背景色变透明功能，具体操作如下：";
            // 
            // 说明label6
            // 
            this.说明label6.AutoSize = true;
            this.说明label6.Font = new System.Drawing.Font("宋体", 10.5F, System.Drawing.FontStyle.Regular, System.Drawing.GraphicsUnit.Point, ((byte)(134)));
            this.说明label6.Location = new System.Drawing.Point(-1, 139);
            this.说明label6.Name = "说明label6";
            this.说明label6.Size = new System.Drawing.Size(1043, 14);
            this.说明label6.TabIndex = 6;
            this.说明label6.Text = "透明度波动是给透明度值加上随机波动，这样水印颜色会有随机波动，就不容易被画图着色功能去掉。波动不为0后调水印参数可能会较卡,所以请到最后再设置此参数。";
            // 
            // 说明label5
            // 
            this.说明label5.AutoSize = true;
            this.说明label5.Font = new System.Drawing.Font("宋体", 10.5F, System.Drawing.FontStyle.Regular, System.Drawing.GraphicsUnit.Point, ((byte)(134)));
            this.说明label5.Location = new System.Drawing.Point(0, 116);
            this.说明label5.Name = "说明label5";
            this.说明label5.Size = new System.Drawing.Size(1463, 14);
            this.说明label5.TabIndex = 5;
            this.说明label5.Text = "保存文件夹功能可以将打开的文件夹中的所有图片，包括所有子目录中的，都加上当前设置的水印并保存到指定文件夹中。保存时请不要选择原文件夹，以免覆盖原文件。最好新建一个" +
    "文件夹，此功能不会提示有同名文件，会直接覆盖。";
            // 
            // 说明label4
            // 
            this.说明label4.AutoSize = true;
            this.说明label4.Font = new System.Drawing.Font("宋体", 10.5F, System.Drawing.FontStyle.Regular, System.Drawing.GraphicsUnit.Point, ((byte)(134)));
