            this.说明label4.Name = "说明label4";
            this.说明label4.Size = new System.Drawing.Size(1099, 14);
            this.说明label4.TabIndex = 4;
            this.说明label4.Text = "加日期和时间功能是让水印加上保存水印图片当时的日期和时间。“保存水印设置”可将当前的水印设置保存在文件中，下次可在“已存水印设置”菜单中调出之前保存的设置。";
            // 
            // 说明label3
            // 
            this.说明label3.AutoSize = true;
            this.说明label3.Font = new System.Drawing.Font("宋体", 10.5F, System.Drawing.FontStyle.Regular, System.Drawing.GraphicsUnit.Point, ((byte)(134)));
