            this.说明label3.Name = "说明label3";
            this.说明label3.Size = new System.Drawing.Size(1169, 14);
            this.说明label3.TabIndex = 3;
            this.说明label3.Text = "水印的大小位置等参数都是根据图片尺寸的百分比来计算的，长宽比接近的图片加同样的水印效果相似，长宽比差异较大的图片效果会有差异。因此只适合给长宽比相似的图片批量加水" +
    "印。";
            // 
            // 说明label2
            // 
            this.说明label2.AutoSize = true;
            this.说明label2.Font = new System.Drawing.Font("宋体", 10.5F, System.Drawing.FontStyle.Regular, System.Drawing.GraphicsUnit.Point, ((byte)(134)));
