            this.说明label2.Text = "在“文字水印”文本框中输入文字即可看到水印效果。用鼠标拖动水印可以调整水印位置。鼠标停在界面的文字标签上会显示功能说明。点击滑动条滑块的两边可以精细调整大小。\r\n" +
    "";
